import React from "react";

const Entrance = () => {
  return (
    <div id="entrance" className="d-flex align-items-center">
      <div id="enter-site-content" className="text-center ">
        <h1>Hello, My Name is Thane Engen and I Am a Web Developer</h1>
        <a href="#projects">
          <button type="button" className="red-button">
            View Projects
          </button>
        </a>
      </div>
    </div>
  );
};

export default Entrance;
